function onloadArea() {
	try{
	var lies = document.getElementById("arealist").getElementsByTagName("li");
	for (var i=0; i<lies.length; i++) {
		lies[i].onmouseover= function() {
			this.className="lion";
		}
		lies[i].onmouseout= function() {
			this.className="";
		}
	}
	}
	catch(e){}
}

chjar.sel={
	/*构建一个选项*/
	bo:function(sel, o, sv){/*sel:被操作的select DOM对象, o:添加的值与名称, sv:选中的选项值*/
		var opt=new Option(o.text,o.value);
		sel.options.add(opt);
		if(sv!=undefined && sv==o.value){
			sel.options[sel.options.length-1].selected=true;
		}
	},
	/*构建select 对象*/
	bs:function(sel, list, sv){/*sel:被操作的select DOM对象, list:需要添加的分类数组, sv:选中的选项值*/
		if(sel!=undefined && list!=undefined)
		for(var i=0;i<list.length;i++){
			var a=list[i];this.bo(sel, {text:a.n,value:a.i}, sv);
		}
	},
	/*清空select[clear select],clsa: 是否剩余第一项 */
	cs:function(sel, clsa){
		if(sel!=undefined){
			var lfi=(clsa!=undefined?1:0);
			while(sel.options.length>lfi){
				sel.options.remove(sel.options.length-1); 
			}
		}
	}
};
chjar.empty=function(s){
	return (s==null||s==undefined||s.replace(/^\s+|\s+$/g,"").length<1||isNaN(s));
}
/*
*	初始化select
	参数:obj分类三个select 对象[p:一级, c:二级, d:三级]dom对象
	参数:cs 当前分类 选中的选项的值[p:一级, c:二级, d:三级]
*/
chjar.initSelect=function(obj, cs){
	if(obj!=undefined){
		if(cs==undefined)cs={p:"",c:"",d:""};
		if(cs.p==undefined)cs.p="";
		if(cs.c==undefined)cs.c="";
		if(cs.d==undefined)cs.d="";
		if(obj.c!=undefined){
			this.sel.cs(obj.c);
			this.sel.bo(obj.c,{text:"请选择城市",value:""});
			obj.c.onchange=function(){//二级分类联动
				chjar.sel.cs(obj.d);
				chjar.sel.bo(obj.d,{text:"请选择区县",value:""});
				chjar.sel.bs(obj.d, chjar.search(parseInt(obj.c.value)));
			}
		}
		if(obj.d!=undefined){
			this.sel.cs(obj.d);
			this.sel.bo(obj.d,{text:"请选择区县",value:""});
		}
		if(obj.p!=undefined){
			this.sel.cs(obj.p);
			this.sel.bo(obj.p,{text:"请选择省份",value:""});
			this.sel.bs(obj.p, this.search(null,"p"),cs.p);
			obj.p.onchange=function(){//二级分类联动
				chjar.sel.cs(obj.c);
				chjar.sel.bo(obj.c,{text:"请选择城市",value:""});
				chjar.sel.bs(obj.c, chjar.search(parseInt(obj.p.value)));
				chjar.sel.cs(obj.d);
				chjar.sel.bo(obj.d,{text:"请选择区县",value:""});
			}
			if(this.empty(cs.p)==false && this.empty(cs.c)==false){
				this.sel.bs(obj.c, this.search(parseInt(cs.p)),cs.c);
				if(this.empty(cs.d)==false){
					this.sel.bs(obj.d, this.search(parseInt(cs.c)),cs.d);
				}
			}
		}
	}
}









